import React from 'react';
import logo from './logo.svg';
import './App.css';
import Videos from './components/videos/videos'

function App() {
  return (
    <div className="App">
      <header id='header'>Youtube Channel API</header>
      <QueryForm/>
      <Videos/>
    </div>
  );
}

class QueryForm extends React.Component {
  render() {
    return (
      <form>
        <h1>Specify Search Results:</h1>
        <p>Channel:</p>
        <input type="text"/>
        <p>Number of Videos:</p>
        <input type="text"/>
        <p>Keyterms:</p>
        <input type="text"/>
        <input type='submit'/>
      </form>
    );
  }
}

export default App;
